{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.4.0"},"kaggle":{"accelerator":"none","dataSources":[],"dockerImageVersionId":30749,"isInternetEnabled":true,"language":"r","sourceType":"notebook","isGpuEnabled":false}},"nbformat_minor":4,"nbformat":4,"cells":[{"source":"<a href=\"https://www.kaggle.com/code/soumyadipr/diamond-cut-prediction-with-knn-and-tuning?scriptVersionId=255338759\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","source":"# Diamond Cut Prediction with KNN and Hyperparameter Tuning\n\nThis notebook applies the **K-Nearest Neighbors (KNN)** classification algorithm to predict the **cut quality** of diamonds using the popular **Diamonds dataset** from the `ggplot2` package in R.\n\nThe dataset contains information on 53,940 round cut diamonds, including:\n- **carat** (weight)\n- **cut** (Fair, Good, Very Good, Premium, Ideal) – *target variable*\n- **color** (D–J)\n- **clarity** (I1–IF)\n- **depth, table, price**, and physical dimensions (*x*, *y*, *z*)\n\nWe will:\n1. Perform **data preprocessing** (removing categorical predictors, normalizing numeric variables)\n2. Split data into **training** and **testing** sets\n3. Train a baseline KNN model\n4. **Tune** the hyperparameter `k` for optimal performance\n5. Evaluate the final model using a confusion matrix and accuracy score\n","metadata":{}},{"cell_type":"code","source":"# Load required libraries\nlibrary(ggplot2)\nlibrary(class)\nlibrary(gmodels)\nlibrary(ggplot2)\n\n# Load diamonds dataset into a data frame\ndata <- as.data.frame(diamonds)\n\n# View structure\nstr(data)\n","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-08-10T20:59:57.398073Z","iopub.execute_input":"2025-08-10T20:59:57.400486Z","iopub.status.idle":"2025-08-10T20:59:58.141319Z","shell.execute_reply":"2025-08-10T20:59:58.139536Z"}},"outputs":[{"name":"stdout","text":"'data.frame':\t53940 obs. of  10 variables:\n $ carat  : num  0.23 0.21 0.23 0.29 0.31 0.24 0.24 0.26 0.22 0.23 ...\n $ cut    : Ord.factor w/ 5 levels \"Fair\"<\"Good\"<..: 5 4 2 4 2 3 3 3 1 3 ...\n $ color  : Ord.factor w/ 7 levels \"D\"<\"E\"<\"F\"<\"G\"<..: 2 2 2 6 7 7 6 5 2 5 ...\n $ clarity: Ord.factor w/ 8 levels \"I1\"<\"SI2\"<\"SI1\"<..: 2 3 5 4 2 6 7 3 4 5 ...\n $ depth  : num  61.5 59.8 56.9 62.4 63.3 62.8 62.3 61.9 65.1 59.4 ...\n $ table  : num  55 61 65 58 58 57 57 55 61 61 ...\n $ price  : int  326 326 327 334 335 336 336 337 337 338 ...\n $ x      : num  3.95 3.89 4.05 4.2 4.34 3.94 3.95 4.07 3.87 4 ...\n $ y      : num  3.98 3.84 4.07 4.23 4.35 3.96 3.98 4.11 3.78 4.05 ...\n $ z      : num  2.43 2.31 2.31 2.63 2.75 2.48 2.47 2.53 2.49 2.39 ...\n","output_type":"stream"}],"execution_count":1},{"cell_type":"markdown","source":"## Data Preprocessing\nKNN requires numeric input features, so we will:\n- Remove the categorical variables `cut` (target), `color`, and `clarity` from features.\n- Normalize numeric features so that each contributes equally to distance calculations.\n- Split the dataset into training (80%) and testing (20%) sets.\n","metadata":{}},{"cell_type":"code","source":"# Remove categorical predictors (color, clarity) and the target column cut from features\nnew_data <- data[, -c(2, 3, 4)]\n\n# Normalization function\nnorm <- function(x) {\n  (x - min(x)) / (max(x) - min(x))\n}\n\n# Apply normalization to numeric predictors\ndata_norm <- data.frame(lapply(new_data, norm))\n\n# Split into train/test\nset.seed(123)\nind <- sample(2, nrow(data_norm), replace = TRUE, prob = c(0.8, 0.2))\ntrain_data <- data_norm[ind == 1, ]\ntest_data  <- data_norm[ind == 2, ]\ntrain_label <- data$cut[ind == 1]\ntest_label  <- data$cut[ind == 2]\n\n# Check sizes\ncat(\"Total rows:\", nrow(data), \"\\n\",\n    \"Train:\", nrow(train_data), \"\\n\",\n    \"Test:\", nrow(test_data), \"\\n\")\n","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-08-10T20:59:58.143987Z","iopub.execute_input":"2025-08-10T20:59:58.214279Z","iopub.status.idle":"2025-08-10T20:59:58.277768Z","shell.execute_reply":"2025-08-10T20:59:58.27604Z"}},"outputs":[{"name":"stdout","text":"Total rows: 53940 \n Train: 43226 \n Test: 10714 \n","output_type":"stream"}],"execution_count":2},{"cell_type":"markdown","source":"## Model Training\nWe will train a KNN classifier with `k = 230` neighbors.  \nAlthough large, this follows our experimental setup.\n","metadata":{}},{"cell_type":"code","source":"# Train KNN model\nmodel <- knn(train_data, test_data, cl = train_label, k = 230)\n\n# Confusion matrix\ntab <- table(Predicted = model, Actual = test_label)\nprint(tab)\n\n# Accuracy\naccuracy <- sum(diag(tab)) / sum(tab) * 100\ncat(\"KNN Model Accuracy:\", round(accuracy, 2), \"%\\n\")\n","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-08-10T20:59:58.280344Z","iopub.execute_input":"2025-08-10T20:59:58.374245Z","iopub.status.idle":"2025-08-10T21:00:08.545925Z","shell.execute_reply":"2025-08-10T21:00:08.543972Z"}},"outputs":[{"name":"stdout","text":"           Actual\nPredicted   Fair Good Very Good Premium Ideal\n  Fair        95    2         0       0     0\n  Good       174  300        85       5     2\n  Very Good   35  313       557     132    59\n  Premium     25  263       939    2253   250\n  Ideal       17   70       791     413  3934\nKNN Model Accuracy: 66.63 %\n","output_type":"stream"}],"execution_count":3},{"cell_type":"markdown","source":"## Visualizations\nWe will create:\n1. Bar chart of cut class distribution in train and test sets.\n2. Heatmap of the confusion matrix for easier interpretation.\n","metadata":{}},{"cell_type":"code","source":"# Bar chart for train/test distribution\ntrain_cuts <- table(train_label)\ntest_cuts  <- table(test_label)\ncut_levels <- levels(data$cut)\nbar_data <- data.frame(\n  Cut = rep(cut_levels, 2),\n  Count = c(as.numeric(train_cuts[cut_levels]), as.numeric(test_cuts[cut_levels])),\n  Dataset = rep(c(\"Train\", \"Test\"), each = length(cut_levels))\n)\n\nggplot(bar_data, aes(x = Cut, y = Count, fill = Dataset)) +\n  geom_bar(stat = \"identity\", position = \"dodge\") +\n  labs(title = \"Distribution of Diamond Cut Classes\",\n       x = \"Cut\", y = \"Count\") +\n  theme_minimal()\n\n# Heatmap of confusion matrix\nconf_df <- as.data.frame(tab)\ncolnames(conf_df) <- c(\"Predicted\", \"Actual\", \"Freq\")\n\nggplot(conf_df, aes(x = Actual, y = Predicted, fill = Freq)) +\n  geom_tile() +\n  geom_text(aes(label = Freq), color = \"white\", size = 5) +\n  scale_fill_gradient(low = \"blue\", high = \"darkblue\") +\n  labs(title = \"Confusion Matrix Heatmap: KNN Model\",\n       x = \"Actual Cut\", y = \"Predicted Cut\") +\n  theme_minimal()\n","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-08-10T21:00:08.548727Z","iopub.execute_input":"2025-08-10T21:00:08.550202Z","iopub.status.idle":"2025-08-10T21:00:09.719132Z","shell.execute_reply":"2025-08-10T21:00:09.717217Z"}},"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3zcdf3A8c/lcllN2rTpAEqhdDBK2bJaluwNIlOGbNlbioKAoIjIRhAUWYoC\nikwRf2wEKgiIyCrFsqGU7jb7xu+PQCkdyaVNcuknz+cfPJrvffP9vu97d+2L761ELpcLAAAs\n+4oKPQAAAB1D2AEARELYAQBEQtgBAERC2AEARELYAQBEQtgBAERC2AEARKKnh11iIcWllYNX\nWW2vI77/wKvTFlj5pR+sm0gkdnrqkw4fY4Etnzi4KpFIvFWf7vAdLbyvbqJu8hOHbbNB/8qS\nQWv+cHHrdJMbq1CuGN43kUg8NKOh9dVymTn3XnfBPttvMmS5/uWpkj79Bq632Q5nXf77qc3Z\nLhgyz72/+vMNE4nENve91wUjAfQoPT3sWgwZPmKe5apLP3t/4j03XbrHeoMP/MXjS7PZXLb2\n2Wefff7FDztqzmV0hnyct/letzz+cmq1zXfcYmTra3bSjRWH2o8f32HE4G8df96fH3n+87ow\naPCgRP30V579v5+ffvCwVbd/blobUbiwdt1/OnzvALRbrmdrOQgvz22af+HcT9647sx9U4lE\nCOGIP787b/nUl+6/5ZZbHplcl+fGm+a+HELovdKP2lxzgS2fsEJlCOHNuuZ8r0Z7ZmjvtegK\n2cZUIpGq