bel, k = k)\n  tab_tune <- table(pred, test_label)\n  accuracy_values[i] <- sum(diag(tab_tune)) / sum(tab_tune) * 100\n}\n\n# Combine into a data frame for plotting\ntune_results <- data.frame(\n  K = k_values,\n  Accuracy = accuracy_values\n)\n\n# Plot accuracy vs k\nlibrary(ggplot2)\nggplot(tune_results, aes(x = K, y = Accuracy)) +\n  geom_line(color = \"blue\") +\n  geom_point(color = \"red\") +\n  labs(title = \"KNN Hyperparameter Tuning\",\n       x = \"Number of Neighbors (k)\",\n       y = \"Accuracy (%)\") +\n  theme_minimal()\n\n# Best k\nbest_k <- tune_results$K[which.max(tune_results$Accuracy)]\nbest_acc <- max(tune_results$Accuracy)\ncat(\"Best k:\", best_k, \"with Accuracy:\", round(best_acc, 2), \"%\\n\")\n","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-08-10T21:00:09.722208Z","iopub.execute_input":"2025-08-10T21:00:09.723845Z","iopub.status.idle":"2025-08-10T21:02:07.010959Z","shell.execute_reply":"2025-08-10T21:02:07.007633Z"}},"outputs":[{"name":"stdout","text":"Best k: 22 with Accuracy: 70.29 %\n","output_type":"stream"},{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3wT5R8H8M9dVptO9ix7bwQRBUSGCgLKEBRQhrKXCEhRf8pWUEGWqIADEERQ\nUUEcBdlThuy9N6V7Jk3u+f2R0kVa0jbNJeHzfvHi1V5ufO+aXj69u+d5JCEEiIiIiMjzyWoX\nQERERETOwWBHRERE5CUY7IiIiIi8BIMdERERkZdgsCMiIiLyEgx2RERERF6CwY6IiIjISzDY\nEREREXkJzwt2cVenS5JkLNLR7qu75vaSJEmjC/ronxtRZ1+XJEmSpEn77tid+dSXzSRJqvvm\nvrQpeVgki+SoDZIkaQ2ls5thY/vykiQ9OvNIdjOQx9n3Zl3JAc8fDnfWFg+83UCSpPZbbzhr\nhURE5B20ahfgTP99NbjFm6tkjfH9X46Mb1066mzq9I869Bt98/dgreT4qvKwCLkzoSTs2v2f\n1lDuscYhTl+5T9FyVaokZ9zW+Qs3JUlbuXKFjLOVMmicvmkiIqKMvCfYnVk9rsmgxULSj//h\n8MQO5TO+lHT3j3ZTdu+Z8oTja8vDIuTOLElnmjdvHljuvZjLU5y+8nrv/n723fRvk6M2+Bbu\nIOuKnT17NvuF8qVC96nf1ogsU6NQAa2fiIg8lOfdirXryh+TG/SabRGakUsPzOhWJeNLxmIv\n+2vkfz9sv+5OkoNry8MiRK5U5JFOffv2bVvCV+1CiIjIvXhDsLu1fXb956ckK9LrX+6d+0rt\nLK/6Fnnh93ENFUvs689Nd3CFeVjENRRzslU4b3XCdCdFcf0mHFrOmphktjqv