code","source":"# Retrain and evaluate KNN with the best k found during tuning\nbest_k <- tune_results$K[which.max(tune_results$Accuracy)]\ncat(\"Using best k =\", best_k, \"\\n\")\n\nfinal_model <- knn(train_data, test_data, cl = train_label, k = best_k)\n\n# Confusion matrix for the best k\nfinal_tab <- table(Predicted = final_model, Actual = test_label)\nprint(final_tab)\n\n# Accuracy for final model\nfinal_accuracy <- sum(diag(final_tab)) / sum(final_tab) * 100\ncat(\"Final KNN Model Accuracy with k =\", best_k, \":\", round(final_accuracy, 2), \"%\\n\")\n","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-08-10T21:02:07.015636Z","iopub.execute_input":"2025-08-10T21:02:07.01752Z","iopub.status.idle":"2025-08-10T21:02:11.035948Z","shell.execute_reply":"2025-08-10T21:02:11.033741Z"}},"outputs":[{"name":"stdout","text":"Using best k = 22 \n           Actual\nPredicted   Fair Good Very Good Premium Ideal\n  Fair       215   16         0       0     1\n  Good       103  454       152      15     5\n  Very Good   14  289       791     263   127\n  Premium     10  149       770    2168   223\n  Ideal        4   40       659     357  3889\nFinal KNN Model Accuracy with k = 22 : 70.16 %\n","output_type":"stream"}],"execution_count":6},{"cell_type":"markdown","source":"## Final Model Evaluation with Optimized k\n\nWe retrained the KNN classifier using the optimal number of neighbors (`k`) determined by hyperparameter tuning.  \nThis approach improves the model’s predictive performance compared to using an arbitrary high `k` value.\n\nThe confusion matrix above shows classification breakdowns using the best k, and the final accuracy demonstrates the model’s effectiveness on the test set.\n\nThis completes our KNN modeling pipeline on the Diamonds dataset.\n\n---\n","metadata":{}},{"cell_type":"markdown","source":"# Conclusion\n\nThrough systematic hyperparameter tuning of **K** in the KNN algorithm, we identified that the optimal number of neighbors for this dataset is **22**.\n\n**Key Results:**\n- **Best k**: 22\n- **Test Accuracy**: ~70.16%\n\nGiven the multi-class nature of the problem and the large dataset size, this accuracy is both sensible and credible. The results show that a moderately high k value smooths out noise while retaining enough local detail to make accurate predictions.\n\n**Next Steps for Improvement:**\n- Explore feature engineering (e.g., combining dimensions into volume)\n- Incorporate categorical variables (`color`, `clarity`) via encoding\n- Compare with tree-based or ensemble models for potential accuracy gains\n\nThis end-to-end workflow demonstrates how **data preparation + tuning** can significantly impact model performance and lays the groundwork for more advanced modeling experiments.\n","metadata":{"execution":{"iopub.status.busy":"2025-08-10T21:02:11.039898Z","iopub.execute_input":"2025-08-10T21:02:11.041527Z","iopub.status.idle":"2025-08-10T21:02:11.064242Z","shell.execute_reply":"2025-08-10T21:02:11.059599Z"}}}]}